An alien criminal kills the young Agent K in 1969, altering the timeline, 
changing the Agency and placing the Earth in danger. Veteran Agent J (Will Smith) 
must travel back in time to 1969 to before the murder and work with the young Agent
 K (Josh Brolin) to save him, the Agency, the Earth and humanity itself.


